int Smin;
int n0 = 6;

int *Popt;
std::vector<int> localCycle;
int infinity = 1000000;
int rootM = infinity;
int countVariants = 0;
Node *left;
Node *right;

void branchingLeft(Node *from, int row, int col){
	left = from->leftBranching(row, col);
}

void branchingRight(Node *from, int row, int col){
	right = from->rightBranching(row, col);
}


void filterTree(std::vector<Node*> &tree) {

	std::vector<Node*> updated;
	for (int i = 0; i < tree.size(); i++)
	if (tree.at(i)->S < Smin)
		updated.push_back(tree.at(i));

	std::sort(updated.begin(), updated.end(), [](Node*  const& a, Node*  const &b) {
		return a->S < b->S;
	});


	tree.clear();
	tree.assign(updated.begin(), updated.end());
}

void startEngine(int *M) {
	localCycle.reserve(100);
	std::vector<Node*> tree;
	tree.reserve(100);
	Node *X0 = new Node(n0, 0, 0);
	X0->setInitialMatrix(M);
	X0->invokeAdduction();

	//	X0->printMatrix();

	rootM = X0->S;
	Node *node = X0;
	bool removeProcess = false;
	do
	{
		if (node->size == 2) {

			countVariants++;
			if (node->S < Smin) {
				Smin = node->S;
				Popt = node->P;
				node->handleStraightforwardMatrix();
			}

			clock_t start = clock();
			filterTree(tree);
			clock_t end = clock();
			clock_t waiter = end - start;

			if (tree.size() == 0)
				break;

			node = tree.front();
			tree.erase(tree.begin());
		}
		else {
			int row = -1;
			int col = -1;
			node->getPathForRemove(row, col);
			srand(time(NULL));

			Node *left = node->leftBranching(row, col);

			Node *right = node->rightBranching(row, col);

			// MAYBE IN THREADS .... but slowest

			//std::thread t1(branchingLeft, node, row, col);
			//std::thread t2(branchingRight, node, row, col);

			//t1.join();
			//	t2.join();

			if (right->S <= left->S) {
				node = right;
				tree.insert(tree.begin(), left);
			}
			else if (left->S < right->S) {
				node = left;
				tree.insert(tree.begin(), right);
			}
		}
	} while (tree.size() > 0);

}



